		<div>
			<h4>Hello from dashboard</h4>
		</div>
	);
};

export async function getServerSideProps(context) {
    const res = await axios.get("http://localhost:3000/api/admin/projects")
    const projects = res.data

    return {
      props: {projects},
    }
  } 

export default login;
